// Import react 
import React from 'react';
// Import the Routes and Route components from react-router 
import { Routes, Route } from "react-router";
// Import the page components 
import Home from "./assets/markup/pages/Home";
import Login from "./assets/markup/pages/Login";
import AddEmployee from './assets/markup/pages/admin/AddEmployee';


// Import the css files 
// import "./assets/template_assets/css/bootstrap.css";
// import "./assets/template/_assets/css/style.css";
// import "./assets/template_assets/css/responsive.css";
// import "./assets/template_assets/css/color.css";

// Import the custom css file 
// import "./assets/styles/custom.css";

// Import the Header component 
import Header from './assets/markup/components/Header/Header';
// Import the Footer component
import Footer from './assets/markup/components/Footer/Footer';


function App() {
  return (
    <>
      <Header />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/login" element={<Login />} />
        <Route path="/admin/add-employee" element={<AddEmployee />} />
      </Routes>
      <Footer />
    </>
  );
}

export default App;
